// Export all icons as a map for easy access
export const ProviderIcons = {
	anthropic: AnthropicIcon,
	cloudrift: CloudriftIcon,
	deepseek: DeepseekIcon,
	"google-ai-studio": GoogleStudioAIIcon,
	groq: GroqIcon,
	"inference.net": InferenceNetIcon,
	mistral: MistralIcon,
	openai: OpenAIIcon,
	perplexity: PerplexityIcon,
	"together.ai": TogetherAIIcon,
	xai: XAIIcon,
	moonshot: MoonshotIcon,
	novita: NovitaIcon,
	alibaba: AlibabaIcon,
	nebius: NebiusIcon,
	zai: ZaiIcon,
} as const;

export type ProviderIconKey = keyof typeof ProviderIcons;

const FAMILY_TO_PROVIDER: Record<string, ProviderIconKey> = {
	anthropic: "anthropic",
	openai: "openai",
	google: "google-ai-studio",
	gemini: "google-ai-studio",
	"google-ai-studio": "google-ai-studio",
	mistral: "mistral",
	xai: "xai",
	perplexity: "perplexity",
	deepseek: "deepseek",
	cloudrift: "cloudrift",
	groq: "groq",
	inference: "inference.net",
};

export const getProviderIcon = (
	provider: string,
	family?: string,
): React.FC<React.SVGProps<SVGSVGElement>> | null => {
	const exact = ProviderIcons[provider as ProviderIconKey];
	if (exact) {
		return exact;
	}
	const normalized = provider
		?.toLowerCase()
		.replace(/[^a-z0-9]/g, "-") as ProviderIconKey;
	if (ProviderIcons[normalized]) {
		return ProviderIcons[normalized];
	}
	const famKey = family ? FAMILY_TO_PROVIDER[family.toLowerCase()] : undefined;
	return famKey ? ProviderIcons[famKey] : null;
};
